import "./Content1.css"

const Data1 = () => {
    return (
        <div className="container">
            <div className="row align-items-center">
                {/* First Column */}
                <div className="col-lg-6 col-md-12">
                    <h6>Hello, my name is Pravin Potadar</h6>
                    <h1>I am a Professional Web Designer & Developer</h1>
                </div>

                {/* Second Column */}
                <div className="col-lg-6 col-md-12">
                    <img 
                        src="https://via.placeholder.com/400" // Replace with your image URL
                        alt="Pravin Potadar"
                        className="img-fluid" // Bootstrap class for responsive image
                    />
                </div>
            </div>
        </div>
    );
};

export default Data1;
